import {
  View,
  Text,
  Platform,
  TextInput,
  StyleSheet,
  Button,
} from "react-native";

export default class ListOfFuelUps extends Component {
  static propTypes = {};

  constructor(props) {
    super(props);
  }
  render() {
    return (
      <View style={styles.container}>
        <h1>Eddigi tankol√°said:</h1>
        <AddNew />
        <NewButton list={fuelUp} />

        {fuelUp.map((curr, i, array) => (
          <CustomComponent
            FuelUp={curr}
            PreviousFuelUp={i != 0 ? array[i - 1] : undefined}
          />
        ))}
      </View>
    );
  }
}

const styles = StyleSheet.create({});
